          <Button style={{marginRight:"20px",marginTop:'-20px' , width:"200px"}} variant="outline-success" onClick={() => setShow(!show)} >Add New Movie</Button>


    <div className="Add">
    <AddMovie  addMovie={addMovie} />
    </div>


 </>
    )
}
export default NavBar;
